DESCRIBE ratings;
-- 
-- Заполняем данными таблицу "Оценки, отзывы".
-- 
-- 
-- Обновить инфорамацмю в таблице "Оценки, отзывы", после вставки данных.
-- 
-- Обновляем дату создания записи
UPDATE ratings SET created_at=DATE_FORMAT(created_at,'2020-%m-%d %T');
-- 
-- Обновляем поля покупатель и продукт
UPDATE ratings SET user_id = (SELECT id FROM users ORDER BY RAND() LIMIT 1);
UPDATE ratings SET product_id = (SELECT id FROM products ORDER BY RAND() LIMIT 1);

